uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Parameters defined in the JSON
uniform float u_speed;
uniform float u_blob_smoothness;
uniform int u_subdivision;
uniform float u_camera_dist;
uniform float u_glow_intensity;
uniform float u_color_hue;
uniform float u_metaball_scale;

out vec4 fragColor;

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Polynomial smooth min for organic blending
float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// 3D Noise function for surface distortion
float hash(vec3 p) {
    p = fract(p * 0.3183099 + 0.1);
    p *= 17.0;
    return fract(p.x * p.y * p.z * (p.x + p.y + p.z));
}

// Distance Field for the "Smashing Blobs"
float map(vec3 p) {
    float t = iTime * u_speed;

    // Global rotation for the scene
    p.xz *= rot(t * 0.2);
    p.zy *= rot(t * 0.1);

    float d = 1e10;

    // Core collision blobs
    for(int i = 0; i < u_subdivision; i++) {
        float fi = float(i);

        // Oscillation logic: Blobs rush towards center then explode outwards
        float phase = t + fi * 1.57;
        float dist_mod = sin(phase * 1.5) * 3.5;

        // Position of each blob relative to origin
        vec3 pos = vec3(
            sin(phase + fi) * dist_mod,
            cos(phase * 0.8 + fi * 1.3) * dist_mod,
            sin(phase * 1.1 - fi * 0.5) * dist_mod
        );

        // Calculate the individual sphere distance
        float sphere = length(p - pos) - (u_metaball_scale * (0.8 + 0.4 * sin(t + fi)));

        // Apply "Splitting" effect - when blobs are far, they look like droplets
        // We add a subtle high-frequency ripple when they are close to collision
        float collision_stress = 1.0 - smoothstep(0.0, 2.0, length(pos));
        sphere -= collision_stress * 0.15 * sin(10.0 * p.x + t) * sin(10.0 * p.y);

        d = smin(d, sphere, u_blob_smoothness);
    }

    // Add a bit of background noise distortion to the field
    d += 0.02 * sin(10.0 * p.x + t) * sin(10.0 * p.y + t);

    return d;
}

// Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.001, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

// Simple Fresnel for that "soapy/organic" look
float fresnel(vec3 n, vec3 rd) {
    return pow(clamp(1.0 + dot(n, rd), 0.0, 1.0), 3.0);
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float t = iTime * u_speed;

    // Camera setup
    vec3 ro = vec3(0.0, 0.0, -u_camera_dist);
    vec3 ta = vec3(0.0, 0.0, 0.0);

    // Interaction
    if(iMouse.z > 0.0) {
        float mouseX = (iMouse.x / iResolution.x - 0.5) * 10.0;
        float mouseY = (iMouse.y / iResolution.y - 0.5) * 10.0;
        ro.xz *= rot(mouseX);
        ro.yz *= rot(mouseY);
    }

    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0.0, 1.0, 0.0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f + uv.x * r + uv.y * u);

    // Raymarching loop
    float d = 0.0;
    float total_dist = 0.0;
    float glow = 0.0;

    for(int i = 0; i < 80; i++) {
        vec3 p = ro + rd * total_dist;
        d = map(p);

        // Glow calculation: Accumulate brightness based on proximity to the surface
        glow += exp(-3.0 * d) * u_glow_intensity;

        if(d < 0.001 || total_dist > 30.0) break;
        total_dist += d * 0.7; // Relaxed step for smoother blending
    }

    // Shading
    vec3 col = vec3(0.0);

    if(total_dist < 30.0) {
        vec3 p = ro + rd * total_dist;
        vec3 n = getNormal(p);
        vec3 lightDir = normalize(vec3(1.0, 2.0, -1.0));

        // Diffuse & Specular
        float diff = max(dot(n, lightDir), 0.0);
        float spec = pow(max(dot(reflect(-lightDir, n), -rd), 0.0), 32.0);
        float fre = fresnel(n, rd);

        // Dynamic coloring based on position and time
        vec3 baseCol = 0.5 + 0.5 * cos(u_color_hue * 6.28 + vec3(0, 2, 4) + p.z * 0.2 + t * 0.5);

        col = baseCol * diff;
        col += spec * 0.8;
        col += fre * baseCol * 1.5;

        // Attenuation
        col *= exp(-0.05 * total_dist);
    }

    // Add the accumulated glow
    vec3 glowCol = 0.5 + 0.5 * cos(u_color_hue * 6.28 + vec3(0, 1, 2) + t);
    col += glowCol * glow * 0.05;

    // Post processing
    col = pow(col, vec3(0.4545)); // Gamma correction
    col *= 1.0 - dot(uv, uv) * 0.4; // Subtle vignette

    fragColor = vec4(col, 1.0);
}
